import React from 'react';

class DogBar extends React.Component {
    state = {
        selectedDogId: ''
    }

    render() {
        const { dogs, selectedDog } = this.props

        return (
            dogs.map(dog => <span key={dog.id} selectedDogId={dog.id} onClick={selectedDog}>{dog.name}</span>)
        )
    }
}

export default DogBar
